import React,{ useState,useEffect} from 'react'
import { DataGrid } from '@material-ui/data-grid';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';
import { makeStyles } from '@material-ui/core/styles';
import axios from "axios";
import { useHistory } from "react-router-dom";
import { logout } from "../../features/userSlice";
import { useDispatch } from "react-redux";

const useStyles = makeStyles((theme) => ({
    button: {
      margin: theme.spacing(1),
    },
}));

export default function TableUserAdmin({columns}) {
    const [selectionModel, setselectionModel] = useState();
    const [rows, setRows] = useState([]);
    const history = useHistory();
    const classes = useStyles();
    const dispatch = useDispatch();
    useEffect(() => {
      axios.get("/account/check-login/", {headers:{Authorization: 'Bearer '+localStorage.getItem('token')}} )
      .then((res) => {
        if(res.status===200){
          axios.get("/account/get-all/", {headers:{Authorization: 'Bearer '+localStorage.getItem('token')}} )
          .then((res) => {
            if(res.status===200){
              setRows(res.data.filter(row => row.is_staff===false));
            }
          }).catch((error) => console.log(error.message));
        }
      }).catch((error) => { dispatch(logout()); history.push('/signin')});
        
    },[]);
    return (
        <>
            <div style={{ height: 400, width: '100%' }}>
                <DataGrid rows={rows} columns={columns} pageSize={5} 
                    checkboxSelection 
                    onSelectionModelChange={(newSelection) => {
                        setselectionModel(newSelection.selectionModel);
                    }}
                    selectionModel={selectionModel}
                    />
            </div>
            <div className="list_btn">
                  <Button
                      variant="contained"
                      color="secondary"
                      className={classes.button}
                      startIcon={<DeleteIcon />}
                  />
            </div>
        </>
  );
}
